# File description: This properties file for the OptionSet options OptionSetOptionsDialog.
#
#   Filename: optionsetoptionslocalization_locale.properties
#   Module  : com.teamcenter.rac.commands.send.optionsetoptionslocalization
#
#===================================================================================================
#   Date       Name                    Description of Change
# 20-AUG-2009  Stanley Zhao            Initial creation
# 08-Dec-2015  Jianbin Chen            Remove SiteName form key and add keys for some options
# $HISTORY$
#
#
# User can provide the translations of options' displayName, description and groupName.
# The key should be like:
#
# %TransferOptionSetName%_%Option%_displayName
# %TransferOptionSetName%_%Option%_description
# %TransferOptionSetName%_%Option%_groupName
#
# Example:
# TIEOptionSetDefault_opt_jt_ds_displayName=IncludeJTDatasets_translatedValue
# TIEOptionSetDefault_opt_jt_ds_description=ExportJTDatasets_translatedValue
# TIEOptionSetDefault_opt_jt_ds_groupName=Relations_translatedValue
#
# Here TIEOptionSetDefault is the TransferOptionSetName,
#      opt_jt_ds           is the Option
#      XXX_translatedValue is the translated value of the option's property 
# 
# This file is the default properties file. User can add some other localization files for it. 
# The file name should be like optionsetoptionslocalization_locale_%LanguageCode%.properties
# Here LanguageCode may be like de, es, fr,it,zh_CH, etc.
#
#=================================================================================================*/
